import React, { Fragment } from 'react'
import fenrir from '../data/fenrir.png'

const Navbar = () => {
    return(

        <nav>
            <img src={fenrir} alt='logotipo fenrir'/>
            <li>Sobre mi</li>
            <li>Proyectos</li>
            <li>Contacto</li>
        </nav>

    );
}

export default Navbar;
